b\u043e \u0440\u0430\u0431\u043e\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%B0%D1%8F_%D0%B2%D1%8B%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B0_(1906)\" title=\"\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430 (1906)\">\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u043e\u0439 \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0438<\/a> \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BB%D0%B0%D0%BD\" title=\"\u041c\u0438\u043b\u0430\u043d\">\u041c\u0438\u043b\u0430\u043d\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1908_%D0%B3%D0%BE%D0%B4\" title=\"1908 \u0433\u043e\u0434\">1908<\/a>&#160;\u2014 \u041e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%B0%D1%8F_%D0%B0%D1%81%D1%81%D0%BE%D1%86%D0%B8%D0%B0%D1%86%D0%B8%D1%8F_%D1%8D%D1%81%D0%BF%D0%B5%D1%80%D0%B0%D0%BD%D1%82%D0%BE\" class=\"mw-redirect\" title=\"\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u0430\u044f \u0430\u0441\u0441\u043e\u0446\u0438\u0430\u0446\u0438\u044f \u044d\u0441\u043f\u0435\u0440\u0430\u043d\u0442\u043e\">\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u0430\u044f \u0430\u0441\u0441\u043e\u0446\u0438\u0430\u0446\u0438\u044f \u044d\u0441\u043f\u0435\u0440\u0430\u043d\u0442\u043e<\/a> (UEA).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910_%D0%B3%D0%BE%D0%B4\" title=\"1910 \u0433\u043e\u0434\">1910<\/a>&#160;\u2014 \u0412 \u043d\u043e\u0447\u044c \u0441 27 \u043d\u0430 28 \u0430\u043f\u0440\u0435\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%93%D1%80%D1%8D%D1%85%D0%B5%D0%BC-%D0%A3%D0%B0%D0%B9%D1%82,_%D0%9A%D0%BB%D0%BE%D0%B4&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0413\u0440\u044d\u0445\u0435\u043c-\u0423\u0430\u0439\u0442, \u041a\u043b\u043e\u0434 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041a\u043b\u043e\u0434 \u0413\u0440\u044d\u0445\u0435\u043c-\u0423\u0430\u0439\u0442<\/a> (Claude Grahame-White), \u043f\u044b\u0442\u0430\u044f\u0441\u044c \u043e\u0431\u043e\u0439\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D0%B0%D0%BD,_%D0%9B%D1%83%D0%B8\" title=\"\u041f\u043e\u043b\u0430\u043d, \u041b\u0443\u0438\">\u041b\u0443\u0438 \u041f\u043e\u043b\u0430\u043d\u0430<\/a>, \u0442\u0430\u043a\u0436\u0435 \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0432\u0448\u0435\u0433\u043e \u0443\u0447\u0430\u0441\u0442\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D0%B0%D1%8F_%D0%B3%D0%BE%D0%BD%D0%BA%D0%B0_%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD_%E2%80%94_%D0%9C%D0%B0%D0%BD%D1%87%D0%B5%D1%81%D1%82%D0%B5%D1%80_(1910)\" title=\"\u0412\u043e\u0437\u0434\u0443\u0448\u043d\u0430\u044f \u0433\u043e\u043d\u043a\u0430 \u041b\u043e\u043d\u0434\u043e\u043d \u2014 \u041c\u0430\u043d\u0447\u0435\u0441\u0442\u0435\u0440 (1910)\">\u0432 \u0433\u043e\u043d\u043a\u0435<\/a> \u043f\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D1%87%D0%B5%D1%81%D1%82%D0%B5%D1%80\" title=\"\u041c\u0430\u043d\u0447\u0435\u0441\u0442\u0435\u0440\">\u041c\u0430\u043d\u0447\u0435\u0441\u0442\u0435\u0440<\/a> \u0441 \u043f\u0440\u0438\u0437\u043e\u0432\u044b\u043c \u0444\u043e\u043d\u0434\u043e\u043c \u0432 10 000 \u0444\u0443\u043d\u0442\u043e\u0432 \u0441\u0442\u0435\u0440\u043b\u0438\u043d\u0433\u043e\u0432, \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u043d\u043e\u0447\u043d\u043e\u0439 \u043f\u043e\u043b\u0451\u0442 \u043d\u0430 \u0430\u044d\u0440\u043e\u043f\u043b\u0430\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043d \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%B4%D0%B8%D1%86%D0%B8%D0%BE%D0%BD%D0%B5%D1%80\" title=\"\u041a\u043e\u043d\u0434\u0438\u0446\u0438\u043e\u043d\u0435\u0440\">\u043a\u043e\u043d\u0434\u0438\u0446\u0438\u043e\u043d\u0435\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u041e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\u0441\u043a\u0430\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\u0441\u043a\u043e\u0439 \u0421\u0421\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4_%D0%B2_%D0%BA%D0%B8%D0%BD%D0%BE\" title=\"1925 \u0433\u043e\u0434 \u0432 \u043a\u0438\u043d\u043e\">1925<\/a>&#160;\u2014 \u041d\u0430 \u044d\u043a\u0440\u0430\u043d\u044b \u0432\u044b\u0448\u0435\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0444\u0438\u043b\u044c\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B9%D0%B7%D0%B5%D0%BD%D1%88%D1%82%D0%B5%D0%B9%D0%BD,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u042d\u0439\u0437\u0435\u043d\u0448\u0442\u0435\u0439\u043d, \u0421\u0435\u0440\u0433\u0435\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u0421\u0435\u0440\u0433\u0435\u044f \u042d\u0439\u0437\u0435\u043d\u0448\u0442\u0435\u0439\u043d\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D1%87%D0%BA%D0%B0_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC)\" title=\"\u0421\u0442\u0430\u0447\u043a\u0430 (\u0444\u0438\u043b\u044c\u043c)\">\u0421\u0442\u0430\u0447\u043a\u0430<\/a>\u00bb. \u0421\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u0439 \u0435\u0433\u043e \u0440\u0430\u0431\u043e\u0442\u043e\u0439 \u0441\u0442\u0430\u043b \u00ab\u0411\u0440\u043e\u043d\u0435\u043d\u043e\u0441\u0435\u0446 \u201e\u041f\u043e\u0442\u0435\u043c\u043a\u0438\u043d\u201c\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930<\/a>&#160;\u2014 \u0412\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> 